const Navbar = () => {
    return ( 
        <div>
            <nav>
                <ul className="nav">
                    <h1>ToDo List</h1>
                    <button className="AddButton">New Work</button>
                </ul>
            </nav>
        </div>
    );
}
 
export default Navbar;
